/*End code section*/

/*Begin code section*/
if(IN_ENABLE == 1){
    if(IN_MICROGRID_STATUS == 1){
        // Set status to tied
        setStatus(&droop, TIED);
        // Active power ramp
        if(IN_P0 > p_ref) p_ref += 2;
        if(IN_P0 < p_ref) p_ref -= 2;

        // Reactive power ramp
        if(IN_Q0 > q_ref) q_ref += 2;
        if(IN_Q0 < q_ref) q_ref -= 2;

        // Set new power reference
        setP0(&droop, p_ref);
        setQ0(&droop, q_ref);

    }else{
        // Set status to islanded
        setStatus(&droop, ISLANDED);

        // Set power reference to zero
        setP0(&droop, 0);
        setQ0(&droop, 0);
    }

    // Droop controller execution
    executeDroop(&droop, IN_V_DIR, IN_V_QUAD, IN_I_DIR, IN_I_QUAD, &v, &p, &q);

    // Set Ki
    setKi(&droop, IN_KI);

    // Set Kv
    setKv(&droop, IN_KV);

    // Output values
    OUT_V = v;
    OUT_PF = p;
    OUT_QF = q;
}else{
    // Output values
    OUT_V = 0;
    OUT_PF = 0;
    OUT_QF = 0;
}
